import React from 'react';
import { Row, Col } from 'antd';
import Health from './images/health.png'

function Statistical() {
    return (
        <section className="static">
            <div className="container">
                <div className="number">
                    <Row gutter={[16, 16]}>
                        <Col xs={{span: 24}} sm={{span: 24}} md={{span: 24}} lg={{span: 6}} lx={{span: 6}}>
                            <div className="text-center">
                                <div className="bg-white p-12 rounded-full inline-block"><img src={Health} alt =""/></div>
                                <h1 className="mb-0 text-white text-8xl">100</h1>
                                <p className="text-white text-3xl">Ca cứu hộ</p>
                            </div>
                        </Col>
                    </Row>
                </div>
            </div>
        </section>
    );
}

export default Statistical;
